import React, { useState } from "react";
import { Tooltip} from 'reactstrap';
function Resume() {
  const [tooltipOpen, setTooltipOpen] = useState(false);

  const toggle = () => setTooltipOpen(!tooltipOpen);
  return (
   <div className="resume">
     <ul className="my-docs">

      <li> <a href="https://docs.google.com/document/d/1vXIsliEyme3tdptIIsl0S2njY9_fpnvdDBnrAOf3kJM/edit?usp=sharing"><i class="far fa-file"></i><span className="res"> Click here to chirp </span></a></li>

      <li> <a href="https://docs.google.com/document/d/1vXIsliEyme3tdptIIsl0S2njY9_fpnvdDBnrAOf3kJM/edit?usp=sharing" id="portfolio">My Original Portfolio</a></li>
      <li> <a href="https://docs.google.com/document/d/1vXIsliEyme3tdptIIsl0S2njY9_fpnvdDBnrAOf3kJM/edit?usp=sharing"><i class="fab fa-linkedin" id="linked-in"></i></a></li>
      <li> <a href="https://docs.google.com/document/d/1vXIsliEyme3tdptIIsl0S2njY9_fpnvdDBnrAOf3kJM/edit?usp=sharing"><i class="fab fa-github" id="github"></i></a></li>

 </ul> 
   </div>
  );
}

export default Resume;
